class Node(object):    def __init__(self, val):        self.val = val        self.next = Noneclass LinkList(object):    def __init__(self):        self.head = None    def insert(self, data):        new_node = Node(data)        if self.head:            current = self.head            while current.next:                current = current.next            current.next = new_node        else:            self.head = new_node    def show(self):        current = self.head        while current:            print(current.val)            current = current.nextLL1 = LinkList()LL1.insert(1)LL1.insert(2)LL1.insert(3)LL1.insert(4)LL1.insert(5)LL1.show()